    <section className='page'>
      <div className="h-screen flex w-screen jus items-center  bg ">

        <div className="p-4 rounded-lg relative">

            <h1 className="text-6xl text-gray-300">Welcome to Our Website</h1>
            <p className="text-gray-200">La première clinique spécialisée dans La prise en charge du Diabète pluridisciplinaire en Mauritanie</p>
